// import s from './MyPosts.module.css';

import Post from './Post/Post';
import s from './MyPosts.module.css'

const MyPosts = () => {

    let posts = [
        {id: 1, message: 'Hello! How are you?', likesCount: 7},
        {id: 2, message: 'It\'s time to go snowboarding! Who goes with me?', likesCount: 9},
        {id: 3, message: 'Aloha! I\'m on Havai!', likesCount: 7},
    ]
    
    return (
        <div className={s.postsBlock}>
            <h3>My posts</h3>
            <div>
                <div>
                    <textarea></textarea>
                </div>
                <div>
                    <button>Add post</button>
                </div>
            </div>
            <div className={s.posts}>
                <Post message='Hello! How are you?' likesCount="3" />
                <Post message="It's time to go snowboarding! Who goes with me?" likesCount="8" />
                <Post message="Aloha! I'm on Havai!" likesCount="2" />
            </div>
        </div>
    )
}

export default MyPosts;
